let LIST = [];

function getResponseList() {
    fetch('http://127.0.0.1:8080/toDelete/X', {
        method: 'GET',
        headers: {
            'Content-Type': 'application/json',
        },
    })
        .then(response => response.json())
        .then(r => {
            LIST = r;

            LIST = [
                {
                    image: "data:image/png;base64,",
                    prediction: 1,
                    date: "22/05/2025 15:53",
                },
                {
                    image: "data:image/png;base64,",
                    prediction: 4,
                    date: "22/05/2025 15:54",
                },
                {
                    image: "data:image/png;base64,",
                    prediction: 3,
                    date: "22/05/2025 15:55",
                }
            ];

            // console.log(r); //stampo la risposta dell'🐝🐝
            printList(LIST);

        })
        .catch(e => {
            console.error(e);
        });
}


function printList(list) {
    const listContainer = document.getElementById('list-container');
    let cards = '';

    list.forEach(item => {
        cards += `
        <div class='card'>
            <img src='${item.image}' alt='number to guess'>
            <div class='data'>
                <div class='date'>${item.date}</div>
                <div class='guess'>${item.prediction}</div>
            </div>
        </div>
        `;
    });

    listContainer.innerHTML = cards;
}


function orderBy(param, list, callback) {
    switch (param) {
        case 'date':
            list.sort((a, b) => (new Date(a.date.split('/').reverse().join('-')) - new Date(b.date.split('/').reverse().join('-'))));
            break;
        case 'number':
            list.sort((a, b) => (a.prediction - b.prediction));
            break;
        default: break;
    }

    callback(list);
}


